import NavBar from "../components/sideNavBar";
import React from "react";
import Projects from "../components/projects";
import AllRoutes from "../routes";
// import { ProjectProp } from "../components/projects";

type ProjectProp = {
    name: string,
    dateLastModified: string,
}

const Home = () => {

    const [isOnEditor, setIsOnEditor] = React.useState(false);

    const updatePageState = (onEditor : boolean): void => {
        setIsOnEditor(isOnEditor);
    }

    const proj1 : ProjectProp = { name: "test1", dateLastModified: "4.6.23" }
    const proj2 : ProjectProp = { name: "test2", dateLastModified: "4.4.23" }
    const proj3 : ProjectProp = { name: "test3", dateLastModified: "2.4.23" }

    const projs = [proj1, proj2, proj3]

    return (
        <>
        <h1>
         MUSICODE
         </h1>
         <NavBar isOnEditor={isOnEditor} updatePageState={updatePageState}/>
         {AllRoutes}
         <Projects {...projs} />
        </>
    )


}

export default Home;
